const testEditorContent = {
  type: "doc",
  content: [
    {
      type: "heading",
      attrs: { level: 3 },
      content: [{ type: "text", text: "Introduction" }],
    },
    {
      type: "paragraph",
      content: [
        {
          type: "text",
          marks: [{ type: "bold" }],
          text: "Title: The Enchanting World of Dogs: A Blog",
        },
      ],
    },
    { type: "horizontalRule" },
    {
      type: "paragraph",
      content: [{ type: "text", text: "The History of Man's Best Friend" }],
    },
    {
      type: "paragraph",
      content: [
        {
          type: "text",
          text: "Dogs, our loyal companions, have always held a special place in our hearts. Their unwavering loyalty, playful antics, and unconditional love make them an integral part of many families. In this blog, we will explore the fascinating world of dogs, delving into their behavior, history, and the unique bond they share with humans.",
        },
      ],
    },
    { type: "paragraph" },
    {
      type: "image",
      attrs: {
        src: "data:image/png;base64,",
        alt: null,
        title: null,
        width: 483.389,
        height: 277.819,
      },
    },
    {
      type: "paragraph",
      content: [
        {
          type: "text",
          text: "Dogs have been by our side for thousands of years, evolving from wild wolves to the domesticated pets we know and love today. Their history is intertwined with ours, as they have played various roles throughout different civilizations. From hunting partners to loyal guardians, dogs have always been there for us.",
        },
      ],
    },
    {
      type: "heading",
      attrs: { level: 3 },
      content: [{ type: "text", text: "The Diversity of Dog Breeds" }],
    },
    {
      type: "paragraph",
      content: [
        {
          type: "text",
          text: "One of the most remarkable aspects of dogs is the incredible diversity of breeds that exist. From the tiny Chihuahua to the majestic Great Dane, each breed has its own unique characteristics and traits. Whether you prefer a small lap dog or a large, energetic companion, there is a dog breed to suit every lifestyle.",
        },
      ],
    },
    {
      type: "heading",
      attrs: { level: 3 },
      content: [{ type: "text", text: "The Psychology of Dogs" }],
    },
    {
      type: "paragraph",
      content: [
        {
          type: "text",
          text: "Understanding the behavior of dogs is key to forming a strong bond with them. Dogs are highly social animals that thrive on companionship and interaction. By learning about their body language, communication cues, and emotional needs, we can better understand and care for our furry friends.",
        },
      ],
    },
    {
      type: "heading",
      attrs: { level: 3 },
      content: [{ type: "text", text: "The Benefits of Owning a Dog" }],
    },
    {
      type: "paragraph",
      content: [
        {
          type: "text",
          text: "Owning a dog comes with a myriad of benefits, both for our physical and mental well-being. Studies have shown that spending time with dogs can reduce stress, improve mood, and even lower blood pressure. The companionship and love that dogs provide are truly invaluable.",
        },
      ],
    },
    {
      type: "heading",
      attrs: { level: 3 },
      content: [{ type: "text", text: "Conclusion" }],
    },
    {
      type: "paragraph",
      content: [
        {
          type: "text",
          text: "In conclusion, dogs hold a special place in our lives as cherished companions and loyal friends. Their unconditional love and unwavering loyalty make them truly unique creatures. By understanding and appreciating the world of dogs, we can forge a deeper connection with these wonderful animals and enrich our lives in countless ways.",
        },
      ],
    },
    { type: "horizontalRule" },
    {
      type: "paragraph",
      content: [
        {
          type: "text",
          text: "Feel free to share your thoughts on this blog post about dogs!",
        },
      ],
    },
  ],
};

